  input: '"TEXT","F3XA","C00143743","Transfers shown on Schedule H4 to the non-federal
    account were made for refunds/reimbursements received by the Committee and shown
    on Schedule A Line 15 and represent COBRA insurance payments made by the Committee
    to Humana and sublease rent and postage paid by the Texas Federation of Republican
    Women.  Items on Schedule B, line 21(a), that the Commission questions were for
    Fundraising activities, not express advocacy for a federal candidate.  The expenditures
    do not meet the definition of Federal Election Activity and are accordingly disclosed
    on line 21(b).  All expenses associated with salary and benefits for employees
    of the committee who spend more than 25 percent of their time during that month
    on activities in connection with a Federal Election have been moved to appear
    on Line 30 (b).  Items on Schedule A Line 15 for Praxis List Co., Texans for Henry
    Bonilla, and Teresa for Congress are for sales of lists and are properly reflected
    as offsets.  Additionally, receipts from San Jacinto Public Affairs of $17,573.32
    disclosed as offsets to operating expenditures relate to list sales, while previously
    reported disbursements to San Jacinto Public Affairs of $11,225.20 relate to convention
    management.  This amendment reflects requested corrections and is filed pursuant
    to your letter dated 09/01/04."'
